window.bookSummaryJSON = "<p><b>What will she surrender to him for his protection?</b></p> <p>I'm Vanessa. Someone has broken into my place . . . but taken nothing. I'm terrified. And alone. My work crush appears unexpectedly and offers to keep me safe. At what price? </p> <p>We have a past Rush doesn't remember . . . so I offer him a night he won't forget. But he already knows everything about me—my ambitions, habits, and forbidden desires. And that's not the only secret he's been keeping . . .</p> <p><b>Contains mature themes.</b></p>"; 
